■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<p><table width="600" border="0" align="center" cellpadding="0" cellspacing="0">  <tr>  <td>  <font color="#009999" size="5"><strong>アミノ酸配合で健康と美容をサポート。</strong></font>  </td>  </tr>  </table><br>  <table width="600" border="0" align="center" cellpadding="1" cellspacing="0">   <tr>   <td width="600" valign="top" align="center"><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0144/9178z-01.jpg" width="600px" height="902px" ><br>  <table width="600" border="0" align="center" cellpadding="5" cellspacing="1" bgcolor="#999999">  <tr>  <td bgcolor="#FFFFCC">  <table width="100%" border="0" cellpadding="3" cellspacing="0">  <tr>  <th><font color="#FF0000">------ ココがポイント！ ------</font></th>  </tr>  <tr>    </tr>  <tr>  <td><strong><font size="3" color="#FF9900">●運動の直前または直後の摂取をお勧めいたします</font></strong></td>  </tr>  </table>  </td>  </tr>  </table>  <br>  <table width="600" border="0" align="center" cellpadding="1" cellspacing="0">   <tr>   <td width="600" valign="top" align="left"><font size="3"></p><p>販売者:補完医療製薬株式会社<br>大阪市中央区谷町9-2-27-303Ａ<br><br></p><p>食品として、1日に2粒程度を目安に水などでお召し上がり下さい。万一、体質に合わない場合はご利用を中止して下さい。天然由来の成分を主として使用しているため、多少色のバラツキが生じる場合がございますが、品質には全く問題ありません。<br>  <br>  【原材料】<br>  乳たん白、セルロース、ロイシン、イソロイシン、バリン、ショ糖エステル、プルラン<br>  <br>  【栄養成分表示】(2粒600mgあたり)<br>  エネルギー2.52kcal<br>  たんぱく質0.22g<br>  脂質0.04g<br>  炭水化物0.32g<br>  ナトリウム2.35mg<br>  バリン60mg<br>  ロイシン90mg<br>  イソロイシン60mg<br>  乳たん白(ラクトアルブミン)120mg</font>  </td>  </tr>  </table>  <br><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0">   <tr>   <td width="600" valign="top" align="left">  <br>  <font size="3">私たちの体の16～20％を占めるタンパク質は20種類のアミノ酸で構成され、筋肉や内臓、皮膚など体の重要な組織づくりに欠かせない存在です。20種類のアミノ酸のうち、9種類は体内では合成できず、これを必須アミノ酸と呼びます。その中でもバリン・ロイシン・イソロイシンの3つのアミノ酸は分岐鎖アミノ酸(BCAA)と呼ばれ、筋肉繊維を構成するタンパク質の主成分です。BCAAは、運動時のエネルギー源として重要な役割を果たします。</font>  </td>  </tr>  </table>  </td>  </tr>  </table>    </p><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">私たちの体の16～20％を占めるタンパク質は20種類のアミノ酸で構成され、筋肉や内臓、皮膚など体の重要な組織づくりに欠かせない存在です。20種類のアミノ酸のうち、9種類は体内では合成できず、これを必須アミノ酸と呼びます。その中でもバリン・ロイシン・イソロイシンの3つのアミノ酸は分岐鎖アミノ酸(BCAA)と呼ばれ、筋肉繊維を構成するタンパク質の主成分です。BCAAは、運動時のエネルギー源として重要な役割を果たします。</font></td></tr></table><br><p><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666">  <tr bgcolor="#FFFFFF">  <td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">内容量</font></td>  <td width="75%" align="left"><font color="#333333" size="-1">108g(300mg×360粒)</font></td>  </tr>  <tr bgcolor="#FFFFFF">  <td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td>  <td align="left"><font color="#333333" size="-1">個装サイズ：12×3.5×21cm</font>  </td>  </tr>  <tr bgcolor="#FFFFFF">  <td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td>  <td align="left"><font color="#333333" size="-1">120g</font><br>  <font color="#333333" size="-1">個装重量：190g</font></td>  </tr>  <tr bgcolor="#FFFFFF">  <td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td>  <td align="left"></p><p><font color="#333333" size="-1">区分：健康食品</font><br>  <font color="#333333" size="-1">名称：ＢＣＡＡ含有食品</font><br>  <font color="#333333" size="-1">保存方法：直射日光、高温多湿を避けて保存して下さい。</font><br>  <font color="#333333" size="-1">賞味期限:製造日より720日</font><br>  </td>  </tr>  <tr bgcolor="#FFFFFF">  <td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td>  <td align="left"><font color="#333333" size="-1">日本</font></td>  </tr>  </table></p><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
